import React from 'react';



function sum(a,b){
    let c =a+b;
    return c;
}
function sub(a,b){
    let c =a-b;
    return c;
}
function mult(a,b){
    let c =a*b;
    return c;
}
function div(a,b){
    let c =a/b;
    c= c.toFixed(2);
    return c;
}

export {sum, sub , mult , div};
